/******************************************************************************
      函数说明：显示数字
      入口数据：m底数，n指数
      返回值：  无
******************************************************************************/
u32 mypow(u8 m,u8 n)
{
	u32 result=1;	 
	while(n--)result*=m;    
	return result;
}


/******************************************************************************
      函数说明：显示数字
      入口数据：x,y    起点坐标
                num    要显示的数字
                len    要显示的数字个数
      返回值：  无
******************************************************************************/
void LCD_ShowNum(u16 x,u16 y,u16 num,u8 len,u16 color)
{         	
	u8 t,temp;
	u8 enshow=0;
	for(t=0;t<len;t++)
	{
		temp=(num/mypow(10,len-t-1))%10;
		if(enshow==0&&t<(len-1))
		{
			if(temp==0)
			{
				LCD_ShowChar(x+8*t,y,' ',0,color);
				continue;
			}else enshow=1; 
		 	 
		}
	 	LCD_ShowChar(x+8*t,y,temp+48,0,color); 
	}
} 


/******************************************************************************
      函数说明：显示小数
      入口数据：x,y    起点坐标
                num    要显示的小数
                len    要显示的数字个数
      返回值：  无
******************************************************************************/
void LCD_ShowNum1(u16 x,u16 y,float num,u8 len,u16 color)
{         	
	u8 t,temp;
	u8 enshow=0;
	u16 num1;
	num1=num*100;
	for(t=0;t<len;t++)
	{
		temp=(num1/mypow(10,len-t-1))%10;
		if(t==(len-2))
		{
			LCD_ShowChar(x+8*(len-2),y,'.',0,color);
			t++;
			len+=1;
		}
	 	LCD_ShowChar(x+8*t,y,temp+48,0,color);
	}
}


/******************************************************************************
      函数说明：显示40x40图片
      入口数据：x,y    起点坐标
      返回值：  无
******************************************************************************/
void LCD_ShowPicture(u16 x1,u16 y1,u16 x2,u16 y2,const unsigned char*image) 
{
	int i=0;
	  LCD_Address_Set(0,0,x2,y2);
 
	memcpy(display_data,image,128*128*2);
	
	OLED_DC_Set();//写数据

		for(i=0;i<128*2;i++)
        	{APP_ERROR_CHECK(nrf_drv_spi_transfer(&spi, &display_data[i*128], 128, buf_send, 0));	}		

}

void LCD_ShowPicture_240(u16 x1,u16 y1,u16 x2,u16 y2,const unsigned char*image,unsigned char xy) 
{
	int i=0;
	  LCD_Address_Set(0,0,x2,y2);
 
	memcpy(display_data,image,xy*xy*2);
	
	OLED_DC_Set();//写数据

		for(i=0;i<xy*2;i++)
        	{APP_ERROR_CHECK(nrf_drv_spi_transfer(&spi, &display_data[i*xy], xy, buf_send, 0));	}		

}


